double strategypimm::boardValue( const board& brd, const hash_map<string,int>* context )
{
    float inputs[172];
	float outputs[1];
	
	for( int i=0; i<24; i++ )
	{
        int n = brd.checker(23-i) - brd.otherChecker(23-i);
		int base = 7 * i;
        
		inputs[base+0] = (n == 1) ? 1.0f : 0;		// CPU blot
		inputs[base+1] = (n == -1) ? 1.0f : 0;		// opponent blot
		inputs[base+2] = (n == 2) ? 1.0f : 0;		// etc
		inputs[base+3] = (n == -2) ? 1.0f : 0;
		inputs[base+4] = (n > 2) ? (n - 2) / 2.0f : 0;
		inputs[base+5] = (n < -2) ? (-n - 2) / 2.0f : 0;
		inputs[base+6] = (n == 0) ? 1.0f : 0;		// an empty point
	}
    
    inputs[168] = brd.hit();
    inputs[169] = brd.otherHit();
    inputs[170] = brd.bornIn() / 15.;
    inputs[171] = brd.otherBornIn() / 15.;
    
	EvalNetHuge( inputs, outputs );
    
	return outputs[0];
}

